CREATE VIEW `vlistctg` AS select `categories`.`categoryid` AS `categoryid`,`categories`.`categoryname` AS `categoryname` from `categories` order by `categories`.`categoryid` ;
CREATE VIEW `vlistcustomers` AS select `customers`.`customerid` AS `CustomerID`,`customers`.`companyname` AS `CompanyName`,`customers`.`address` AS `Address`,`customers`.`city` AS `City`,`customers`.`region` AS `Region`,`customers`.`postalcode` AS `PostalCode`,`customers`.`country` AS `Country` from `customers` ;
CREATE VIEW `vlistemp` AS select `employees`.`employeeid` AS `employeeid`,concat(`employees`.`lastname`,_latin1', ',`employees`.`firstname`) AS `employeename` from `employees` ;
CREATE VIEW `vlistproducts` AS select `products`.`productid` AS `productid`,`products`.`productname` AS `productname`,`products`.`unitprice` AS `unitprice` from `products` ;
CREATE VIEW `vlistsp` AS select `suppliers`.`supplierid` AS `supplierid`,`suppliers`.`companyname` AS `companyname` from `suppliers` order by `suppliers`.`supplierid` ;

DELIMITER $$

CREATE PROCEDURE `spgetempfl`()
BEGIN
select employeeid,concat(lastname,', ',firstname) as employeename  from employees ;
END $$

/*`vw1_11000` */

CREATE PROCEDURE `vw1_11000`()
BEGIN
select userid as `user id`, username, photo
from users   ;
END $$


/*`vw1_11100` */

CREATE PROCEDURE `vw1_11100`()
BEGIN
select  employeeid,concat(titleofcourtesy,' ',lastname,', ',firstname) as `employee name`,  employees.title title, birthdate, hiredate, address, city, region, postalcode,country, photo, notes from employees;
END $$


/*`vw1_30100` */

CREATE PROCEDURE `vw1_30100`()
BEGIN
select * from categories;
END $$


/*`vw1_31100` */

CREATE PROCEDURE `vw1_31100`()
BEGIN
select distinct upper( left(productname,1) ) abc, left(productname,1) as alphabetiz from products order by left(productname,1)   ;
END $$


/*`vw1_31200` */

CREATE PROCEDURE `vw1_31200`()
BEGIN
select categoryid, categoryname from categories order by categoryname;   
END $$


/*`vw1_31300` */

CREATE PROCEDURE `vw1_31300`()
BEGIN
select supplierid, companyname from suppliers order by companyname;   
END $$


/*`vw1_31400` */

CREATE PROCEDURE `vw1_31400`()
BEGIN
select products.productid,  products.productname as `product name`,  suppliers.companyname as `supplier name`,  categories.categoryname as `category name`,  products.quantityperunit, products.unitprice as `unit price`,  products.unitsinstock, products.reorderlevel,  if(products.unitsinstock<=products.reorderlevel,255,0) as reordernow,  if(products.unitsinstock<=products.reorderlevel,1,0) as bold from suppliers inner join  (categories inner join products on categories.categoryid = products.categoryid)  on suppliers.supplierid = products.supplierid order by products.productid;   
END $$


/*`vw1_32100` */

CREATE PROCEDURE `vw1_32100`()
BEGIN
select distinct upper( left(companyname,1) ), left(companyname,1) as alphabetiz from suppliers order by left(companyname,1);   
END $$


/*`vw1_32200` */

CREATE PROCEDURE `vw1_32200`()
BEGIN
select distinct city, city kota from suppliers order by city   ;
END $$


/*`vw1_32300` */

CREATE PROCEDURE `vw1_32300`()
BEGIN
select distinct country, country negara from suppliers order by country;   
END $$


/*`vw1_32400` */

CREATE PROCEDURE `vw1_32400`()
BEGIN
select * from suppliers;   
END $$


/*`vw1_41100` */

CREATE PROCEDURE `vw1_41100`()
BEGIN
select distinct upper( left(productname,1) ), left(productname,1) as alphabetiz from products order by left(productname,1);   
END $$


/*`vw1_41200` */

CREATE PROCEDURE `vw1_41200`()
BEGIN
select categoryid, categoryname from categories order by categoryname;   
END $$


/*`vw1_41300` */

CREATE PROCEDURE `vw1_41300`()
BEGIN
select distinct discontinued as status,if(discontinued ,'discount','normal price') text from products;   
END $$


/*`vw1_41400` */

CREATE PROCEDURE `vw1_41400`()
BEGIN
select products.productid productid,  products.productname as `product name`,  suppliers.companyname as `supplier name`,  categories.categoryname as `category name`,  products.quantityperunit quantityperunit,  products.unitprice as `unit price`,  products.unitsinstock as `units stock`,  products.reorderlevel as reorderlevel, products.discontinued,  if( products.discontinued ,1,0) as bold,  if(products.unitsinstock< products.reorderlevel,255,0) as colorize,  products.categoryid +13 as `icon_id` from categories inner join products on categories.categoryid = products.categoryid inner join  suppliers on suppliers.supplierid = products.supplierid  order by products.productid;   
END $$


/*`vw1_42100` */

CREATE PROCEDURE `vw1_42100`()
BEGIN
select distinct upper( left(companyname,1) ), left(companyname,1) as alphabetiz from customers order by left(companyname,1);   
END $$


/*`vw1_42200` */

CREATE PROCEDURE `vw1_42200`()
BEGIN
select distinct city, city kota from customers order by city;   
END $$


/*`vw1_42300` */

CREATE PROCEDURE `vw1_42300`()
BEGIN
select distinct country, country negara from customers order by country;   
END $$


/*`vw1_42400` */

CREATE PROCEDURE `vw1_42400`()
BEGIN
select * from customers   ;
END $$


/*`vw1_43100` */

CREATE PROCEDURE `vw1_43100`()
BEGIN
select employeeid, concat(lastname,', ',firstname) from employees;   
END $$


/*`vw1_43200` */

CREATE PROCEDURE `vw1_43200`()
BEGIN
select customerid, companyname from customers order by companyname;   
END $$


/*`vw1_43300` */

CREATE PROCEDURE `vw1_43300`()
BEGIN
select productid, productname from products order by productname;   
END $$


/*`vw1_43400` */

CREATE PROCEDURE `vw1_43400`()
BEGIN
select distinct year(orderdate) tahun1 ,year(orderdate) tahun2 from orders order by year(orderdate);    
END $$


/*`vw1_43500` */

CREATE PROCEDURE `vw1_43500`()
BEGIN
select orders.orderid orderid, customers.companyname as `customer name`, concat( employees.lastname,', ',firstname) as `employee name`, orders.orderdate orderdate,  orders.requireddate requireddate, orders.shippeddate shippeddate, shippers.companyname as `shipper name`,  orders.freight freight, orders.shipname shipname, orders.shipaddress shipaddress, orders.shipcity shipcity,  orders.shipregion shipregion, orders.shippostalcode shippostalcode, orders.shipcountry shipcountry from  customers inner join orders on customers.customerid = orders.customerid  inner join employees  on employees.employeeid = orders.employeeid inner join  shippers on shippers.shipperid = orders.shipvia order by orders.orderid;   
END $$


/*`vw1_44100` */

CREATE PROCEDURE `vw1_44100`()
BEGIN
select shipperid, companyname from shippers order by shipperid;   
END $$


/*`vw1_44210` */

