/*`vw_orderdetails` */

CREATE PROCEDURE `vw_orderdetails`(IN OID  Int)
BEGIN
select `order details`.orderid orderid,`order details`.productid productid, products.productname productname, `order details`.unitprice unitprice, `order details`.quantity quantity,  `order details`.discount discount, (`order details`.unitprice*quantity*(1-discount)/100)*100 as extendedprice  from products inner join `order details` on products.productid = `order details`.productid  where   `order details`.orderid = OID ;
END $$

CREATE TRIGGER `delete_Details_by_orderid` AFTER DELETE ON `orders` FOR EACH ROW BEGIN
delete from `order details` where orderid=old.orderid;
END $$

CREATE TRIGGER `delete_orders_by_customers` AFTER DELETE ON `customers` FOR EACH ROW BEGIN
delete from orders where customerid = old.customerid;
END $$

CREATE TRIGGER `delete_order_details_by_pid` AFTER DELETE ON `products` FOR EACH ROW BEGIN
delete from `order details` where productid=old.productid;
END $$

